	var cityCenter = {'x':-124.2026, 'y':41.7558};
	var indFocus = document.getElementById("individualfocus");


	var N = 100;
	function makePerim(t) {
		var perim = [];
		var sc = .0075+.0025*Math.sin(t);
		for(var tt=0; tt<N+1; tt++) {
			var xx = cityCenter.x + sc*Math.cos(tt*2*Math.PI/N);
			var yy = cityCenter.y + sc*Math.sin(tt*2*Math.PI/N);
			perim.push([xx,yy]);
		}
		return perim;
	}

	function packagePolygons(multipolygon) {
		var features = [
			{"type": "Feature",
			"geometry": { "type": "MultiPolygon",
			"coordinates": multipolygon}
			}
		]
		return features;
	}

	// load geojson data
	// d3.json("../ptha_tutorial/DataFiles/Events/CSZa/contours.geojson", main);

	// alternative for hard-coded data
	
	var mults = []; // array of small multiples
	
	main(mygeojson4);
	function main(json) {

		// google map background
		var map = new google.maps.Map(document.getElementById('map'), {
			// center: new google.maps.LatLng(47.4,-120.5),
			//center: new google.maps.LatLng(41.759671,-124.20219),
			center: {lat:41.7509671, lng:-124.19219},
			zoom: 14,
			// styles:[{"stylers": [{"lightness": 100}]}],
			styles:[
				{
					"featureType": "all",
					"stylers": [{"color": "#C0C0C0"}]
				}
			],
			mapTypeControl: true,
			streetViewControl: false,
			fullscreenControl: false,
			mapTypeControlOptions: {
				mapTypeIds: ['styled_map', 'terrain']}
			//gestureHandling: "none",
			//zoomControl: false,
			//draggableCursor: 'arrow'
		});

		function focusArea(e) {
			//map.panTo(e.latLng);
			//map.setZoom(15);
			indFocus.style.display = "block";
			panMultiples(e.latLng);
          // map.setCenter(marker.getPosition());
        }
		
		// zoom in and recenter when user clicks on a point
		map.addListener('click', focusArea);

		map.mapTypes.set('styled_map', styledMapType);
        map.setMapTypeId('styled_map');

		// overlay geojson multipolygons on map
		var overlay = new google.maps.OverlayView();

		overlay.onAdd = function () {
			var layer = d3.select(this.getPanes().overlayMouseTarget)
				.append("div")
				.attr("class", "SvgOverlay");
			var svg = layer.append("svg");
			var contours = svg.append("g")
				.attr("class", "contours");
			var overlayProjection = this.getProjection();

			// turn google map projection into d3 projection
			var googleMapProjection = d3.geoTransform({point: function(x, y) {
				d = overlayProjection.fromLatLngToDivPixel( new google.maps.LatLng(y, x) );
				this.stream.point(d.x + 4000, d.y + 4000);
			}});

			var pathproj = d3.geoPath().projection(googleMapProjection);

			// put the elements on the page
			contours.selectAll(".mypoly")
				.data(json.features)
				.attr("d", pathproj)
				.enter()
				.append("path")
				.attr("class", "mypoly")

			// drawing routine
			overlay.draw = function () {
				this.update();
			}
			overlay.update = function() {
				contours.selectAll(".mypoly")
					.attr("d", pathproj)
			}

			var time = 0;
			function anim() {
				d3.select(".mypoly")
					.data(packagePolygons([[makePerim(time)]]))
					.attr("d", pathproj);
				time += .1;
			}
			//setInterval(anim, 30);
			// d3 add paths for each multipolyon
		}

		overlay.setMap(map);


		// For drawing small multiples
		var multcontainer = document.getElementById("smallmultiplescontainer");

		for(var ii=0; ii<6; ii++) {
			var mymultDiv = document.createElement("div");
				mymultDiv.classList.add("smallmultiple");
				mymultDiv.innerHTML = "a";
				multcontainer.appendChild(mymultDiv);
			var mymult = multMaker(mymultDiv,json);
			mults.push(mymult);
		}

		function gogogo() {
			panMultiples({lat:41.7409671, lng:-124.19219});
		}
		setTimeout(gogogo, 1000);
	}

function panMultiples(latLng) {
	for(var ii=0; ii<mults.length; ii++) {
		mults[ii].map.panTo(latLng);
	}
}

function multMaker(containerDiv,json) {

	// google map background
		var map = new google.maps.Map(containerDiv, {
			// center: new google.maps.LatLng(47.4,-120.5),
			//center: new google.maps.LatLng(41.759671,-124.20219),
			center: {lat:41.7509671, lng:-124.19219},
			zoom: 14,
			styles:[{"stylers": [{"lightness": 100}]}],
			mapTypeControl: false,
			streetViewControl: false,
			fullscreenControl: false,
			zoomControl:false,
			mapTypeControlOptions: {
				mapTypeIds: ['roadmap', 'styled_map']}
		});

	map.mapTypes.set('styled_map', styledMapType);
	map.setMapTypeId('styled_map');

	// overlay geojson multipolygons on map
	var overlay = new google.maps.OverlayView();

	overlay.onAdd = function () {
		var layer = d3.select(this.getPanes().overlayMouseTarget)
			.append("div")
			.attr("class", "SvgOverlay");
		var svg = layer.append("svg");
		var contours = svg.append("g")
			.attr("class", "contours");
		var overlayProjection = this.getProjection();

		// turn google map projection into d3 projection
		var googleMapProjection = d3.geoTransform({point: function(x, y) {
			d = overlayProjection.fromLatLngToDivPixel( new google.maps.LatLng(y, x) );
			this.stream.point(d.x + 4000, d.y + 4000);
		}});

		var pathproj = d3.geoPath().projection(googleMapProjection);

		// drawing routine
		overlay.draw = function () {
			var projection = this.getProjection();
			this.update();
		};

		overlay.update = function() {

			contours.selectAll(".mypoly")
				.data(json.features)
				.attr("d", pathproj)
				.enter()
				.append("path")
				.attr("class", "mypoly")
		}
		// d3 add paths for each multipolyon
	}

	overlay.setMap(map);
	return {'map':map}; // in the future, this returned object may contain references to other things associated with the small multiple, such as a label field.
}

indFocus.addEventListener("click",function() { indFocus.style.display ="none"; });
</script>
</body>
</html>
